import React, { useState, useEffect } from "react";
import {Link} from 'react-router-dom'
 const TodoList = () => {
     const TodoList = () => {
        const [items, setItems] = useState([])
      
        useEffect(() => {
          setItems([
            {text: "foo", id: 0},
            {text: "bar", id: 1},
            {text: "bazz", id: 2},
          ])
        },
    [])


    return (
        <div className="container">
          <div className="mt-3">
            <h3>Todo List</h3>
            <table className="table table-striped mt-3">
                    <thead>
                        <tr>
                        <th>Text</th>
                        <th>Action</th>
                        </tr>
                    </thead>
                    <tbody>
                    {
                        items.map(todo =>(
                            <tr key ={todo.id}>
                                <td>
                                    {todo.text}
                                </td>
                                <td>
                                    <Link to = {`/edit/${todo.id}`}>EDIT</Link>
                                </td>

                            </tr>
                        ))
                    }
                    </tbody>
              </table>
              </div>
              </div>
        )
    }
}

module.exports = TodoList
